import { Typography,Container,makeStyles,Card } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  container:{
    display: "flex",
    border: "1px solid #ece7e7",
  },
  media:{
    height: 250,
    [theme.breakpoints.down("sm")]:{
      height: 150,
    },
  },
}));

export default function CardProfile(props) {
  const classes = useStyles();

  return (
    <Container className={classes.container}>
      <Card>
        <CardMedia className={classes.media} image="https://material-ui.com/static/images/cards/paella.jpg" />
      </Card>

    </Container>

  );
}
